// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingContract {
    struct Vote {
        uint userId;
        uint candidateId;
        uint electionId;
        uint timestamp;
    }

    Vote[] public votes; // Mng  lu tr cc phiu bu

    event VoteCast(uint userId, uint candidateId, uint electionId, uint timestamp); // S kin khi c phiu bu mi

    function castVote(uint _userId, uint _candidateId, uint _electionId) public {
        // To mt i tng Vote mi
        Vote memory newVote = Vote({
            userId: _userId,
            candidateId: _candidateId,
            electionId: _electionId,
            timestamp: block.timestamp // Ly timestamp hin ti ca block
        });

        votes.push(newVote); // Thm phiu bu vo mng

        emit VoteCast(_userId, _candidateId, _electionId, block.timestamp); // Pht ra s kin VoteCast
    }

    // Hm  ly s lng phiu bu  c ghi nhn (cho mc ch kim tra)
    function getVoteCount() public view returns (uint) {
        return votes.length;
    }

    // Hm  ly thng tin ca mt phiu bu c th da trn index (cho mc ch kim tra)
    function getVote(uint index) public view returns (Vote memory) {
require(index < votes.length, unicode"Index vt qu gii hn");        return votes[index];
    }
}
